export default {
  data() {
    return {
      dialogVisible: false
    };
  },
  methods: {
    openDialog() {
      this.dialogVisible = true;
    },
    closeDialog() {
      this.dialogVisible = false;
    },
    handleDialogShow() {
      document.body.classList.add('q-body-scroll');
    },
    handleDialogHide() {
      document.body.classList.remove('q-body-scroll');
    }
  }
};
